VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'n and record the patient’s history of allergy to a known drug to prevent possible medication errors. Patients may have extra allergy labels owing to vague symptoms that do not correspond to true allergic reactions or lack of information. Occasionally, allergic reactions occur when patients with allergies are not labeled. An inaccurately defined history of allergy leads to increased use of broad-spectrum antibiotics, increased potential side effects, higher risk of infection by resistant bacteria, increased treatment costs, and prolonged hospitalization. This study primarily aimed to explain the working principles of digital patient identification systems used in recording drug and food allergies of hospitalized patients. Secondly, it was aimed to analyze the data of the digital allergy recording system in the general surgery clinic and make inferences about the results.', '{-0.24658335745334625,-0.26690611243247986,-0.03767392411828041,-0.1302364468574524,0.21537455916404724,0.874634325504303,0.5152037739753723,-0.04538336768746376,-0.2802099585533142,-0.5370578765869141,0.4375949203968048,0.2702863812446594,0.1331619918346405,-0.5524740815162659,0.054813776165246964,0.5123860836029053,0.14145292341709137,0.5488805174827576,-0.06591551750898361,-0.1812935173511505,-0.6878941059112549,-0.18274250626564026,-0.09314531832933426,0.17590723931789398,-0.42049795389175415,0.36558786034584045,0.3176754117012024,-0.37752777338027954,-0.40321338176727295,-0.1200912818312645,-0.1311303675174713,-0.4338890016078949,0.08248843252658844,0.5657853484153748,0.1608748733997345,0.2096000462770462,0.09413197636604309,-0.13462530076503754,-0.3359619379043579,0.7088751792907715,-0.5983553528785706,0.4771602153778076,-0.053302496671676636,-0.6482535004615784,-0.19733116030693054,-0.17764541506767273,0.05855169892311096,0.08392825722694397,-0.33023133873939514,-0.2645440399646759,0.5274900794029236,0.04074819758534431