VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, '. The general surgery clinic consists of 7 specialized subunits and has a total bed capacity of 168. In our hospital, colored wristbands are used to correctly identify patients within the scope of quality standards. All standard patients admitted to the units in our health facility are given a “white” colored identification wristband. If the patient has a history of allergies, a “red” wristband is worn. Different colored wristbands are also available and are used according to the medical condition and history of the patients (Fig.  Identifying patient wristbands (A) white color – for standard patients; (B) red color – for patients with allergies; (C) green color – for patients with catheters or ports; (D) QR code reading and identifying wristband printing machines. The first anamnesis of patients admitted to the clinic is taken by the physician and nurse. After a protocol number is defined for each patient via HIMS, a digital patient card is created.', '{0.6391518115997314,0.14709769189357758,-0.44095826148986816,-0.3841193914413452,-0.29623138904571533,0.05238364636898041,-0.17874859273433685,0.6717353463172913,-0.1386360228061676,0.03178141638636589,0.4288581907749176,-0.29149818420410156,0.37199655175209045,0.2584472894668579,0.40868350863456726,-0.03952482342720032,0.48101839423179626,-0.015246286056935787,0.34115591645240784,-0.8788674473762512,-0.6217837929725647,-0.4126507043838501,-0.21726462244987488,-0.10812225192785263,1.1738420724868774,0.2559565305709839,0.3128521740436554,-0.5801871418952942,-0.2710549235343933,0.29542866349220276,-0.6290655136108398,-0.4897344410419464,-0.27370449900627136,1.1158045530319214,-0.0712076798081398,0.4060353934764862,0.2114339917898178,-0.40255215764045715,-0.4614099860191345,0.2135883867740631,-0.5435092449188232,1.1227941513061523,-0.2078363299369812,-0.4168800413608551,0.26825809478759766,0.20491310954093933,-0.0769471600651741,-0.21700143814086914