VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 9, 'tal during a 1-year period throughout 2023 were retrospectively scanned from HIMS and patient files. During this period, patients who wore a red wristband and had allergy information in the HIMS digital patient card were included in the study. Patients with recurrent hospitalizations were included in the study as 1 patient. Patients with missing data were excluded from the study. Patients who were classified as allergic patients due to allergic asthma, seasonal allergy, pollen allergy, cosmetic product allergy, but did not have food or DA were identified. A preliminary analysis was conducted including the data of these patients in order to determine the rates of inappropriate allergy labeling. Then, the data of patients with inappropriate allergy labels were excluded from the study and the data of patients with drug and/or FA labels were analyzed. Age, gender, history of DA, active ingredient names in drug allergies, and allergenic food type in food allergies were recorded.', '{0.18742838501930237,-0.2780197858810425,0.05477162078022957,0.06612001359462738,-0.21495677530765533,0.9142028093338013,0.39113670587539673,-0.12288970500230789,-0.36937472224235535,-0.9382901191711426,0.23266887664794922,0.4302217960357666,0.8236772418022156,0.01319881621748209,0.18820331990718842,0.7674856781959534,0.38093554973602295,0.37430229783058167,-0.22954165935516357,-0.21404540538787842,-0.8382765650749207,-0.344335675239563,0.18656906485557556,0.6528697609901428,-0.1696346551179886,0.18956343829631805,0.3673107326030731,-0.09545081853866577,-0.2124396562576294,0.035545311868190765,-0.2653648257255554,-0.35178133845329285,-0.3822544813156128,0.9645383358001709,0.4791044592857361,0.3978961110115051,0.03658277913928032,-0.40035462379455566,-1.2868751287460327,-0.042488373816013336,-0.7322200536727905,0.670657753944397,-0.006285583134740591,-0.5602872967720032,-0.8431655168533325,0.10982351750135422,-0.10723283886