VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 11, 'Decision No. 23) approval was obtained for our single-center and retrospective observational study. All procedures were performed in accordance with ethical rules and the principles of the Declaration of Helsinki. Patients are required to sign informed consent forms for the procedures to be performed in the clinic during hospitalization. The data of a total of 5810 patients hospitalized in the general surgery clinic during a 1-year period were scanned and recurrent hospitalizations were recorded once. During the study period, data on 759 patients who used red wristbands and had an allergy warning in the digital patient record system were accessed. The rate of these patients in the entire sample was 13%. However, in the patient group with allergy warnings, allergy labels were also applied to patients who reported that they were allergic to cosmetic products, cleaning chemicals, house dust, pollen, and bee stings.', '{0.38304656744003296,-0.17963509261608124,-0.5061416625976562,-0.2873491048812866,-0.3538544774055481,0.5500057339668274,-0.014525865204632282,-0.277525395154953,-0.10511331260204315,-0.32883119583129883,0.14859573543071747,-0.13534387946128845,0.5573694109916687,-0.6343517899513245,0.4592255651950836,0.4997813403606415,0.3281840682029724,0.26853063702583313,0.3881899416446686,-0.36685141921043396,-0.8218433856964111,-0.16448909044265747,-0.1075420081615448,0.6302253007888794,0.20948198437690735,0.23913238942623138,0.532809853553772,-0.5485393404960632,0.030779197812080383,0.11542658507823944,-0.025191649794578552,-0.36502203345298767,-0.5254586935043335,0.5747365951538086,0.4251437783241272,0.6681386232376099,-0.24895164370536804,-0.25075557827949524,-1.2203369140625,-0.03859362006187439,-0.38014838099479675,0.7885600328445435,0.043975185602903366,-0.626602292060852,0.054935015738010406,0.008666039444506168,0.06444475799798965,-0.01047838106751442,-0.28962695598602295,-0.11391691863