VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 17, 'ulation being 0.20%. Five patients with mushroom allergy were also found to have penicillin allergy. Data for patients with other drug and food allergies are given in Table  Analysis of food allergy labels by food type. Only one patient died during the study period from anaphylactic shock caused by a substance other than that listed on the allergy label. No other patients with an allergy label experienced any adverse events due to allergic reactions. Our study presents the results of a detailed analysis of both food and DA rates in our high-volume general surgery clinic. In the literature, the number of publications addressing food and drug allergies together is quite limited. Although the number of patients with both food and DA labels is low, the high rate of co-occurrence of edible mushrooms and penicillin DA is striking. We could not find any data in the literature that could explain whether this situation is important or not.', '{-0.07576803117990494,-0.8456989526748657,0.2441471517086029,-0.41441255807876587,0.13261207938194275,0.6815193295478821,0.4453108012676239,0.29171979427337646,-0.651641845703125,-0.32932865619659424,0.4986768662929535,0.38949206471443176,0.30598577857017517,-0.8149064779281616,-0.16576974093914032,0.27539193630218506,-0.2226082980632782,0.4279383718967438,0.09221860021352768,0.2536219656467438,-0.4406757950782776,-0.20766715705394745,-0.033697955310344696,0.15056873857975006,-0.2582150399684906,0.8410109281539917,-0.112786203622818,-1.0300812721252441,0.03925106301903725,-0.29028892517089844,-0.09428177773952484,-0.19118423759937286,-0.23340819776058197,0.5653300285339355,0.16835029423236847,-0.12136544287204742,0.3513747453689575,-0.26639625430107117,0.15439537167549133,0.04716739431023598,-1.043761134147644,0.58121657371521,0.22001707553863525,-0.4617256820201874,-0.48766496777534485,-0.2955913245677948,-0.4033198058605194,-0.47961604595184326,0.3904626071453094