VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 18, 'd not find any data in the literature that could explain whether this situation is important or not. Even in a detailed study that shows that edible mushrooms cause food allergies and different allergic reactions and conveys the immunological stages of these allergic mechanisms, we could not see any information about the direct relationship between mushroom and penicillin DA. As in our study, individual drug allergens are reported to be significantly more prevalent in female patients in many studies. In addition, a history of DA has been reported more frequently in elderly patients due to the burden caused by polypharmacy. Studies have shown that surgical site infections have increased due to the decrease in the use of cefazolin for perioperative prophylaxis and the prescription of alternative antibiotics to β-lactams. Patients with reported penicillin allergy are often treated with alternative antibiotics that are broader in spectrum, more toxic, and more expensive.', '{0.01630982756614685,-0.6280918717384338,0.49084070324897766,-0.5477824807167053,-0.24413494765758514,0.47098156809806824,0.3093026280403137,0.5937463045120239,-0.4103318154811859,-0.17487679421901703,0.6640176773071289,0.31251779198646545,-0.2895791828632355,-0.8502818942070007,-0.4588891863822937,0.16173551976680756,-0.5191332101821899,0.29142898321151733,-0.0018258042400702834,0.24677880108356476,-0.014230398461222649,-0.422940731048584,-0.049961354583501816,-0.40517252683639526,-0.6047101020812988,1.1143701076507568,-0.2894286513328552,-0.47246885299682617,0.40422022342681885,0.4974100887775421,0.24210454523563385,0.08223072439432144,-0.005599076859652996,0.4279327392578125,0.010311836376786232,-0.4303227663040161,0.005944278556853533,0.2659529447555542,0.788175106048584,-0.007500592153519392,-0.609287440776825,0.5458170175552368,0.08371681720018387,-0.36580660939216614,-0.9888750910758972,-0.2442886382341385,-0.171681493520