VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 19, 'n treated with alternative antibiotics that are broader in spectrum, more toxic, and more expensive. One study found a 69% increase in the risk of methicillin-resistant  After antibiotics, painkillers are the most common cause of drug allergies. Among painkillers, nonsteroidal anti-inflammatory drugs (NSAIDs) are the most commonly reported subgroup as shown in many studies. Paracetamol and opioids are among the other most common painkiller allergies. In a study of 2431 unique patients, NSAID allergy was reported in 20.7% and paracetamol allergy in 5.3%. Reports of allergy to proton pump inhibitors (PPIs), one of the most commonly used drug groups for both treatment and prophylaxis, are becoming increasingly common. In a study, lansoprazole was reported to be the most common and rabeprazole was reported to be the subgroup with the least allergy history in the PPI group. In the past, radiologic contrast media were one of the most frequently reported groups of allergic reactions.', '{-0.003460888285189867,-0.3793780207633972,0.20563751459121704,-0.2582229971885681,0.04043479636311531,1.2775671482086182,0.720693051815033,1.1178756952285767,0.36636337637901306,-0.7482044696807861,0.3401598334312439,0.06969843804836273,0.3001185357570648,-1.2195851802825928,-0.35408222675323486,0.29900702834129333,0.46131905913352966,0.4237486720085144,0.367288738489151,0.09075722843408585,-1.0787732601165771,0.10684563219547272,-0.5605626106262207,0.09858663380146027,-0.6358057856559753,0.7256856560707092,-0.20685434341430664,-0.8428428769111633,-0.4624262750148773,-0.09983454644680023,-0.02912815660238266,-0.1489759385585785,-0.16145949065685272,0.24693572521209717,0.31756722927093506,-0.044894181191921234,-0.2897051274776459,1.1221405267715454,-0.6218780279159546,-0.17264428734779358,0.015820879489183426,0.28952881693840027,-0.07226738333702087,-0.44522884488105774,-0.0039509194903075695,0.19304990768432617,0.1238