VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 20, 'st, radiologic contrast media were one of the most frequently reported groups of allergic reactions. With the introduction of nonionic, low-osmolar agents, allergic reactions to these agents have declined from 12% to 0.04%. Reactions to gadolinium used in MRI scans are much lower than reactions to radiologic contrast medias used in CT scans. Although reports of allergic reactions to these agents have decreased, drug reactions leading to fatal anaphylaxis can be observed. Fatal anaphylaxis due to allergies is fortunately quite rare. In a comprehensive study, it was emphasized that mortality for drug-induced anaphylaxis was estimated to be 0.05 to 0.51 per million people and 0.03 to 0.32 for food-induced anaphylaxis. It was reported that peanuts or tree nuts account for half of deaths from food-induced anaphylaxis. One of the biggest challenges with allergy labeling is that some of the symptoms that patients describe as allergies may not actually be allergy symptoms.', '{-0.514640748500824,-0.10483520478010178,0.10328321158885956,-0.3507997989654541,-0.14080692827701569,1.4141147136688232,0.3269433379173279,0.31508103013038635,0.09330260753631592,-0.5664322972297668,0.1835939586162567,0.3802841007709503,0.17437805235385895,-0.7624994516372681,-0.3917423486709595,0.5707035064697266,0.5358213186264038,0.40737608075141907,0.15909923613071442,0.657839298248291,-1.063863754272461,0.11338074505329132,-0.15331748127937317,0.0760093703866005,-0.5557966232299805,0.8211608529090881,-0.28589463233947754,-0.5938984751701355,-0.7098538279533386,-0.3520582616329193,-0.1489943116903305,-0.3279329240322113,-0.18632011115550995,-0.1144597977399826,0.008520619943737984,0.19999371469020844,0.17792648077011108,0.2699197828769684,-0.4919028580188751,0.12511642277240753,-0.8043836355209351,0.9428572058677673,0.34558889269828796,-0.37010419368743896,-0.43663376569747925,0.03838522359728813,0.14558884501457214,-0.314523