VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 21, 'that some of the symptoms that patients describe as allergies may not actually be allergy symptoms. The patients with allergy labels for reasons other than food or DA accounted for 35% of the entire allergy label group. Thomas et al reported that red wristbands were used to indicate the presence of allergy in 112 (52.6%) of 213 centers in their prospective multicenter study. Our study had some limitations due to its retrospective nature and the inclusion of patients admitted to only one clinic in a single-center. The main limitations were the lack of any confirmation test for allergies in patients with allergy labels and the lack of an institutional protocol for these patients. In addition, the lack of records of allergic reactions encountered in inpatients and the fact that it was not known whether any tests were performed for allergies after discharge were also weaknesses of our study.', '{0.3000257611274719,-0.3900487422943115,0.029626134783029556,-0.101072758436203,-0.36536291241645813,0.7637941837310791,0.18965932726860046,0.14934055507183075,0.005565122701227665,-0.6011143922805786,0.06743607670068741,0.10150263458490372,0.9221174716949463,-0.39149704575538635,-0.05221737548708916,0.34064820408821106,0.5046226978302002,0.27707406878471375,0.4479047358036041,0.14534741640090942,-1.5370086431503296,-0.332324743270874,0.1555049866437912,0.0921131819486618,-0.37311944365501404,0.5751397013664246,-0.11673440039157867,-0.3747730553150177,-0.19619327783584595,0.15306086838245392,-0.4460538923740387,-0.3300277590751648,-0.794528067111969,0.27548834681510925,0.4359460771083832,0.36917054653167725,0.11348781734704971,-0.7337994575500488,-0.7219834923744202,0.02059139311313629,-0.96439129114151,1.0582740306854248,0.1985972374677658,-0.9060718417167664,-0.15651945769786835,0.3191884458065033,-0.4479280114173889,0.06153485178947449,0.1850915253162384,0.04922908917069435,0.3771289587020874,-0.099814653