VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 22, 'wn whether any tests were performed for allergies after discharge were also weaknesses of our study. Despite all these, we find it valuable to thoroughly detail the rates of both drug and food allergies among all patients admitted to general surgery services within the 1-year period of our study. We believe that the results of this study will serve as a guide for changing the traditional practices of perioperative antibiotic prophylaxis in patients labeled with allergies. Additionally, we hope that the allergenic food sub-analysis related to food allergies in our study will encourage the use of personalized dietary treatments. Accurately inquiring about the allergy histories of hospitalized patients and labeling those with allergies is crucial for preventing potential adverse allergic reactions. Patients’ allergy statuses should be communicated through both identifying wristbands, such as red wristbands, and alert systems on digital patient records.', '{-0.017701512202620506,-0.3207174241542816,-0.33275678753852844,-0.2260751873254776,-0.15208829939365387,0.6505681276321411,0.3243412673473358,0.20407117903232574,-0.15589098632335663,-0.19294026494026184,0.26425230503082275,-0.14874331653118134,0.5222295522689819,-0.6580158472061157,0.31738436222076416,0.44685009121894836,0.11991723626852036,-0.05676884576678276,0.1654026359319687,-0.06093466281890869,-1.0675270557403564,-0.1430618315935135,-0.06518588215112686,0.39495572447776794,-0.33161547780036926,0.3682490587234497,0.16274206340312958,-0.8879697918891907,-0.12618371844291687,-0.10431038588285446,-0.01913948357105255,-0.1076601892709732,-0.1453135460615158,-0.03909698873758316,0.384647399187088,0.32722869515419006,-0.1078377440571785,-0.4627332389354706,-0.2259494662284851,0.18732452392578125,-0.7851337790489197,0.9894068837165833,0.028721479699015617,-0.7969704270362854,-0.048917174339294434,-0.0629439726471901,-0.0013366305502131581,-0.306