VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Systemic mastocytosis (SM) is a rare hematologic disorder characterized by clonal proliferation of mast cells in various tissues, often presenting with skin lesions, gastrointestinal symptoms, or anaphylaxis. However, atypical presentations lacking these classical features may delay diagnosis and complicate management. We report the case of a 42-year-old woman who presented with progressive anemia, recurrent spontaneous intramuscular and intraosseous hemorrhages, and severe, unexplained pain. Notably, she lacked cutaneous signs or known allergic triggers. Extensive laboratory and imaging workups ruled out common hematologic and autoimmune causes. Bone marrow biopsy ultimately revealed multifocal clusters of atypical mast cells consistent with SM, despite the absence of the KIT D816V mutation. This case underscores the protean manifestations of SM and the need to maintain a high index of suspicion in patients with unexplained cytopenia and bleeding.', '{-0.1075601875782013,-0.1545606255531311,0.5452556014060974,-1.2043758630752563,-0.32003480195999146,0.38350197672843933,-0.16921603679656982,0.12533684074878693,-0.37552234530448914,-1.2427607774734497,-0.2633681297302246,0.46674999594688416,-0.6804026365280151,-0.47771796584129333,-0.049719635397195816,0.2610309422016144,0.6600635051727295,-0.40770646929740906,0.5880125164985657,-0.65073162317276,0.02426936663687229,0.42736539244651794,0.4786621630191803,0.23718011379241943,0.07806567847728729,-0.34101778268814087,-1.0067594051361084,-0.3238256275653839,-0.6855136156082153,-0.39354783296585083,-0.5519652366638184,-0.46680617332458496,-0.3077332377433777,0.3466692864894867,0.6268643140792847,1.1257972717285156,-0.04157693311572075,0.6115238666534424,-1.757614016532898,-0.14757509529590607,-0.08513433486223221,1.0468376874923706,-0.40378668904304504,0.9162847399711609,0.13752122223377228,0.8058519959449768,-0.0011402512900531292,0.25622522830963135