VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'the need to maintain a high index of suspicion in patients with unexplained cytopenia and bleeding. It also highlights the role of bone marrow evaluation in the diagnostic pathway, even when classic clinical features are absent. Timely recognition of atypical SM can guide appropriate management and improve patient outcomes. Systemic mastocytosis (SM) is a rare hematologic disorder characterized by the clonal proliferation and accumulation of mast cells, i.e., granulated immune cells that play a key role in allergic reactions and innate immunity, in various tissues, including the bone marrow, skin, gastrointestinal tract, liver, and spleen [ The clinical manifestations of SM are highly heterogeneous, reflecting both the extent of mast cell infiltration in various organs and the systemic effects of mast cell degranulation.', '{-0.09709971398115158,-0.2783682644367218,0.7399039268493652,-1.1877131462097168,-0.34189853072166443,0.3501861095428467,-0.5167322158813477,0.0034942079801112413,-0.6651667952537537,-1.1274442672729492,-0.06060842424631119,0.11855670809745789,-0.7412720918655396,0.023356646299362183,-0.3824383616447449,0.2094588279724121,0.6415498852729797,-0.341138631105423,0.6452459692955017,-0.29027315974235535,-0.01002577319741249,0.22787228226661682,0.46297723054885864,-0.03896665573120117,-0.05349928140640259,-0.496175616979599,-1.0944950580596924,-0.018730271607637405,-0.6382865309715271,-0.5283522605895996,-0.3105831742286682,-0.34640297293663025,-0.19159738719463348,0.18739421665668488,0.22294016182422638,0.8735907077789307,0.10544220358133316,0.3918418288230896,-1.5812859535217285,-0.26749569177627563,-0.187263622879982,1.0749616622924805,-0.2934485673904419,0.6325857043266296,-0.2263772338628769,0.6083449125289917,-0.08743385970592499,-0.02788965404033661,-0.33247461915016174,-0.1363195776939392,0.6611601114273071,0.08633002638816833,-0.30845993757247925,-0.27138200402259827,-1.03