VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 7, 'and a CT scan of the neck to assess for paraganglioma; however, the patient declined these studies. The Hematology team was consulted and advised to start intravenous aminocaproic acid, followed by a transition to an oral formulation. However, due to difficulty swallowing large pills, the patient declined the oral medication and was instead switched to tranexamic acid (TXA), which she tolerated well. For discharge planning, Hematology recommended continuing TXA for an additional three days. Given the patient’s occasional complaints of flushing, a tryptase level was obtained and found to be markedly elevated at 1,191 micrograms per liter (mcg/L) (normal range <11 mcg/L), raising suspicion for mastocytosis. Testing for KIT mutation and beta-glucosidases was ordered to assess for mastocytosis and Gaucher’s disease, respectively, both of which can manifest with bleeding, osteonecrosis, and hepatosplenomegaly were negative. The patient was discharged home with close follow-up.', '{-0.11906492710113525,-0.4011346995830536,0.13003788888454437,-0.9400796890258789,-0.10252177715301514,0.3044055700302124,0.09968854486942291,0.07931146025657654,-0.4900575280189514,-0.7498232126235962,-0.34590256214141846,0.4671188294887543,-0.6049848198890686,-0.5985499620437622,0.09169679135084152,-0.033695805817842484,0.4565700888633728,-0.10207550972700119,0.18485569953918457,-0.3693235218524933,-0.24633604288101196,0.1531836837530136,0.3248744308948517,0.28577277064323425,0.6796217560768127,0.5598355531692505,-0.8237833976745605,-0.22287319600582123,-0.12868155539035797,-0.567359983921051,-0.6011276841163635,0.3561161756515503,-0.2422943413257599,0.5174760222434998,-0.05831615626811981,0.7666364908218384,0.14120334386825562,0.5300240516662598,-1.6762182712554932,-0.02146267332136631,-0.6918883323669434,0.9234415888786316,-0.9502062201499939,0.7955363988876343,-0.16972088813781738,0.6232355237007141,-0.45129603147506714