VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 9, 'A right axilla biopsy and repeat bone marrow biopsy were done. Axilla biopsy indicated mastocytosis. A concurrent second bone marrow biopsy showed aggregates of necrotic ghost cells, with flow cytometry showing no evidence of lymphoproliferative disorder, acute leukemia, or increased blasts. Cytogenetics revealed a normal karyotype. Additional testing revealed elevated factor VIII level, ferritin, and LDH (Table  Acute pain crisis and confirmation of mastocytosis A few weeks later, while off steroids, the patient underwent a final bone marrow biopsy, which demonstrated a cellular marrow with trilineage hematopoiesis and no increase in blasts, indicating preserved hematopoietic function (Table  Mastocytosis is a rare condition characterized by excessive mast cell accumulation, primarily affecting the skin and bone marrow.', '{-0.3349470794200897,-0.4837331473827362,0.25206536054611206,-1.083740472793579,-0.2699810564517975,0.19264502823352814,-0.29617178440093994,-0.15529118478298187,-0.5777706503868103,-0.6655173897743225,-0.4594907760620117,0.4264540374279022,-0.8639696836471558,0.2997170686721802,-0.10911525040864944,-0.12372691184282303,1.175849437713623,0.07668036222457886,0.03293624147772789,-0.6483756303787231,0.3548208773136139,0.22901511192321777,0.3522516191005707,0.21225829422473907,0.800515353679657,-0.2680375576019287,-1.380420446395874,-0.12622736394405365,-0.3195713460445404,-0.41442692279815674,-0.5446796417236328,-0.20098397135734558,-0.09798170626163483,0.45297297835350037,0.1335923671722412,1.2785050868988037,0.30520007014274597,0.34099113941192627,-1.46708345413208,-0.3228452503681183,-0.3471622169017792,1.1479920148849487,-0.47033607959747314,1.1091992855072021,-0.23659244179725647,0.8744385242462158,-0.12890459597110748,0.5724475383758545,-0.09910421818494797,-0.10918307304382324,0.1610659956932068,0.16534775495529175,-0.6429821848869324,-0.2579328417778015,-0.58259874582290