VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 10, 'ion characterized by excessive mast cell accumulation, primarily affecting the skin and bone marrow. Patients with unexplained anaphylaxis, recurrent flushing, chronic skin lesions such as urticaria pigmentosa, or persistently elevated serum tryptase levels should be evaluated for mastocytosis. Additional indications include unexplained cytopenia; osteopenia; chronic gastrointestinal symptoms like diarrhea, nausea, and abdominal pain; or unexplained bleeding. Individuals with a family history of mast cell disorders, resistant allergic conditions, or multi-organ involvement without a clear etiology should also be considered for further testing [ The World Health Organization (WHO) defines SM based on specific diagnostic criteria, including dense mast cell infiltrates in extracutaneous organs, marrow, or blood, as well as minor criteria such as atypical mast cell morphology, KIT D816V mutations, CD25 expression, and persistently elevated serum tryptase levels.', '{-0.5198460817337036,-0.7094258069992065,0.7532174587249756,-1.258777379989624,-0.38129109144210815,0.6973278522491455,-0.20214645564556122,0.21355411410331726,-0.44978639483451843,-1.320756196975708,-0.18285852670669556,0.39789581298828125,-0.4723917543888092,0.027830656617879868,-0.8408161401748657,0.2904953956604004,0.2513183057308197,-0.05782034993171692,0.1295117884874344,-0.1379689872264862,-0.4582822918891907,0.2119540125131607,0.2700194716453552,-0.17740170657634735,-0.0008133089286275208,-0.6696836352348328,-0.9320957064628601,-0.1942692995071411,-0.2515961229801178,-0.2760666608810425,-0.6283234357833862,-0.6885977983474731,-0.18142099678516388,0.5670143365859985,-0.04103997349739075,0.8191877603530884,0.2139616459608078,0.2608478367328644,-1.8500864505767822,-0.2834557294845581,-0.24257788062095642,1.1781376600265503,-0.1831529587507248,0.2332535684108734,-0.44729965925216675,0.8326692581176758,-0.19306516647338867,0.292467772