VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 14, 'uire multiple bone marrow biopsies and serial assessments over time to reach a definitive diagnosis. Importantly, KIT negativity does not rule out SM, but rather suggests greater molecular and genetic variability, which may influence disease progression and treatment options [ Bleeding in mastocytosis results from multiple factors, including heparin release, platelet dysfunction, coagulopathy, gastrointestinal bleeding, and vascular fragility [ A notable finding in this case was the presence of ghost cells in bone marrow, indicative of lysed or degenerated cells. In mastocytosis, these structures suggest mast cell degranulation, leading to the release of histamine, heparin, and other bioactive mediators. This process contributes to tissue damage, fibrosis, and, in advanced cases, bone marrow necrosis [ Management of SM depends on its subtype, symptom severity, and organ involvement, with treatment aimed at controlling symptoms, reducing mast cell burden, and preventing complications.', '{-0.39567291736602783,-0.17751100659370422,0.597967803478241,-1.1223526000976562,-0.28912729024887085,0.03760058432817459,-0.40793049335479736,0.17649777233600616,-0.569726824760437,-0.7579494118690491,0.1658153086900711,0.4092324376106262,-1.0374336242675781,-0.15351983904838562,-0.6779552102088928,0.18798938393592834,0.9019067883491516,-0.2670024335384369,0.44592559337615967,-0.0023337623570114374,-0.20083260536193848,0.17350518703460693,0.35339969396591187,-0.12881161272525787,0.31044653058052063,-0.42010241746902466,-1.2691179513931274,0.08677654713392258,-0.10994988679885864,-0.515887439250946,-0.5176470279693604,-0.050534650683403015,-0.28485068678855896,0.5091458559036255,0.005774450954049826,0.6077786684036255,0.044999342411756516,0.48699960112571716,-1.5134457349777222,-0.21634012460708618,-0.11473458260297775,0.8785730004310608,-0.3820967972278595,0.6374033093452454,-0.5531472563743591,0.70450729131698