VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 15, 'th treatment aimed at controlling symptoms, reducing mast cell burden, and preventing complications. Antihistamines, mast cell stabilizers, and cytoreductive therapies such as tyrosine kinase inhibitors (e.g., midostaurin, avapritinib) are key components of therapy, while chemotherapy is reserved for aggressive forms like mast cell leukemia. Bisphosphonates help manage osteoporosis and bone pain, and avoiding triggers such as heat, alcohol, and certain medications is crucial. KIT-negative mastocytosis, as in our case, may require a tailored approach, but the primary goal remains preventing severe reactions and improving quality of life [ Regular monitoring with serum tryptase measurement, organ function assessment, and genetic testing is essential for tracking disease progression [ Mastocytosis is a rare and underdiagnosed disorder characterized by abnormal mast cell accumulation with systemic involvement.', '{-0.0916367694735527,-0.3512721359729767,0.5676939487457275,-1.3596256971359253,-0.43498820066452026,0.29783448576927185,-0.1930970549583435,0.004714891314506531,-0.5654469728469849,-1.038733959197998,-0.11132274568080902,0.5737579464912415,-0.6915995478630066,-0.40745511651039124,-0.5676948428153992,0.12314275652170181,0.885184109210968,0.07834619283676147,0.331450879573822,-0.06377554684877396,-0.7030985951423645,0.28658220171928406,0.3391267657279968,-0.08014273643493652,0.14954650402069092,-0.24963435530662537,-1.266341209411621,-0.06078288331627846,0.034536443650722504,-0.7398669719696045,-0.47396329045295715,-0.1856895089149475,0.1174720972776413,0.7565976977348328,-0.14511893689632416,0.8187503218650818,-0.0860939547419548,0.6098461151123047,-1.6414116621017456,-0.44976961612701416,-0.23719902336597443,1.2845795154571533,-0.5738206505775452,0.44494491815567017,-0.22604767978191376,0.38154247403144836,-0.15958137810230255,-0.4309755563735962,0.049253396689891815,0.2769037187099457,0.