VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Giant emphysematous bullae (GEB) in chronic obstructive pulmonary disease cause severe respiratory compromise. While surgical resection is standard, bronchoscopic volume reduction is crucial for surgically ineligible patients. Accurate target bronchus identification remains challenging with conventional imaging. A 67-year-old male with chronic obstructive pulmonary disease and right lung GEB presented with severe dyspnea (modified Medical Research Council score 4), hypercapnia (partial pressure of carbon dioxide: 45 mm Hg), and markedly limited exercise tolerance (6-minute walk distance: 62 m). He required home noninvasive ventilation and was deemed unfit for surgery due to critically impaired lung function (Forced expiratory volume in 1 second: 0.36 L, 12.2% predicted). Preoperative high-resolution computed tomography (CT) and 3D reconstruction localized the target bronchus to the right middle lobe.', '{0.7225614190101624,-0.25676825642585754,0.25016701221466064,0.028281312435865402,0.16402845084667206,0.23331047594547272,0.0034559867344796658,-0.780458390712738,0.1335192322731018,0.008324701339006424,-0.07758507877588272,0.2698989510536194,-0.3081824481487274,0.33573177456855774,0.25781136751174927,-0.20344647765159607,-0.8928008079528809,0.44120141863822937,1.1074063777923584,-0.6692646741867065,-0.22589993476867676,-0.09292792528867722,0.10055191814899445,-0.15713633596897125,0.2528323829174042,0.5115741491317749,-0.9007956981658936,0.24402755498886108,-0.5871560573577881,-0.27029886841773987,-0.3840024173259735,-0.49891889095306396,-0.19530810415744781,-0.06796851009130478,-0.43828800320625305,0.8510820269584656,0.4771031141281128,0.14017699658870697,-1.473784327507019,0.8721098899841309,-0.5876616835594177,1.004357099533081,0.4183140695095062,0.06210397183895111,0.583976686000824,-0.4023066759109497,-0.0900038555264473,0.6017726063728333,-0.15042510628700256,0.8174940347671509,-0.030684588