VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'mputed tomography (CT) and 3D reconstruction localized the target bronchus to the right middle lobe. However, percutaneous aspiration and drug injection via drainage tube revealed misalignment, prompting reidentification of the target bronchus in the posterior segment of the right upper lobe. CT-guided percutaneous GEB volume reduction was performed, involving air extraction and intrabullous injection of erythromycin lactobionate. Subsequent selective bronchial occlusion of the posterior right upper lobe segment via bronchoscopic autologous blood and thrombin injection was conducted. Continuous negative-pressure drainage was maintained post-procedure. Follow-up CT at 6 months confirmed complete GEB closure. Dyspnea improved significantly (modified Medical Research Council score 3), exercise capacity increased (6-minute walk distance: 220 m), and ventilator use was discontinued. No complications or recurrence were observed during follow-up.', '{0.3022191822528839,0.08619712293148041,-0.04590902104973793,-0.0039053617510944605,0.0008003084221854806,0.3179013133049011,-0.3053125739097595,-0.8379634618759155,-0.27355727553367615,0.17923198640346527,0.11538628488779068,0.5079993605613708,-0.6519771218299866,-0.23057404160499573,0.6679779291152954,-0.10262633115053177,-0.02482081763446331,0.331847220659256,0.5749897360801697,-0.6006762385368347,0.030660439282655716,-0.33757510781288147,0.4479342997074127,-0.041007719933986664,0.8159777522087097,0.4840599298477173,-0.3696982264518738,0.12104126065969467,-0.3039803206920624,-1.0820164680480957,0.2581062912940979,0.20384462177753448,-0.35196539759635925,0.18383823335170746,-0.25870996713638306,0.8275129795074463,0.5636480450630188,0.4349988102912903,-1.5748894214630127,0.39600110054016113,-0.389475554227829,0.8169825077056885,-0.18169152736663818,-0.43172281980514526,0.4089988172054291,-0.6352062821388245,-0.3052949905395508,0.5911579728126526,0.33891239