VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, '. Endobronchial valve (EBV) placement has emerged as a widely accepted alternative treatment option. A 67-year-old male patient with a 2-year history of GEB in the right lung and an 11-year history of COPD presented to our department. The patient had been regularly using inhaled medications and required home noninvasive ventilator support owing to the severity of his condition. Prior to our intervention, the patient’s lung function tests revealed a forced expiratory volume in 1 second (FEV Step 1: CT-guided GEB Catheterization. The radiologist analyzed the preoperative HRCT results and identified the target bronchus associated with the GEB in the lateral segment of the right middle lobe (Fig.  Procedure of GEB volume reduction and confirmation of the GEB target bronchus in the Patient. (A, B) Before treatment, GEB occupied the right middle and right lower lungs, and the radiologist evaluated the target bronchus as the lateral segment of the right middle lobe (white arrow).', '{0.32607710361480713,-0.1292109340429306,-0.7082653641700745,0.3237828314304352,0.4804140329360962,0.08666183799505234,-0.3827167749404907,-0.32964378595352173,-0.2384662628173828,0.08146598190069199,0.24644947052001953,0.8652423620223999,-0.15441568195819855,-0.42374831438064575,0.15036794543266296,-0.11941011250019073,-0.8813964128494263,0.37425535917282104,0.3361460864543915,-0.4198852777481079,-0.16946065425872803,0.03194425255060196,0.33057159185409546,0.27619093656539917,0.7337022423744202,0.5020158290863037,0.08179028332233429,0.14037397503852844,-0.28515034914016724,-0.5024689435958862,-0.13393926620483398,0.5239384174346924,-0.4665897488594055,0.6231570243835449,-0.09298595786094666,0.702954113483429,0.26068079471588135,0.7346025705337524,-1.5695348978042603,0.04537080600857735,-0.4161492884159088,0.3281995356082916,0.12390828877687454,-0.6002590656280518,0.2792545258998871,-0.17261962592601776,-0.23046863079071045