VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 6, 'thorax. Post-procedure, the patient underwent continuous ECG monitoring and vital sign surveillance. Follow-up CT revealed contraction of the GEB toward the right upper lobe, with drug deposition localized to the posterior segment of the right upper lobe (Fig.  Step 3: Bronchoscopic Selective Bronchial Occlusion. Five days after the GEB puncture, we inserted a 3-chamber lithotomy balloon via bronchoscopy into the posterior segment of the right upper lobe (Fig.  Six-month follow-up CT confirmed complete GEB closure (Fig.  Comparison of lung function, blood gas analysis, dyspnea, and quality of life scores in GEB patients before surgery, before discharge and 6 months after surgery. %pred = %predicted, 6MWT = 6-minute walking testing, FEV The pathogenesis of GEB is closely associated with the progression of COPD. Core mechanisms include smoking, α1-antitrypsin deficiency, intravenous drug use, cannabis and cocaine consumption, sarcoidosis, and autoimmune disorders.', '{0.5187358260154724,0.04358278959989548,-0.0557045042514801,-0.5735376477241516,0.5348302721977234,0.427045613527298,-0.03823477029800415,-0.9061698317527771,-0.3910462558269501,-0.29868587851524353,0.3133808374404907,0.2877838611602783,-0.45175668597221375,-0.5499961376190186,0.09170322865247726,0.18107642233371735,0.4435352385044098,0.4652988612651825,0.9812187552452087,-0.4295092225074768,-0.5455896258354187,-0.17048263549804688,0.2854864001274109,-0.06265469640493393,0.19248713552951813,0.31066879630088806,-0.0970391184091568,-0.035288967192173004,-0.16694436967372894,-0.7600970268249512,0.11646107584238052,0.21550339460372925,-0.5392548441886902,0.6822446584701538,0.17272073030471802,0.7919449210166931,0.12727975845336914,0.26983842253685,-1.1153407096862793,0.3935070335865021,-0.2799351215362549,1.041641116142273,-0.34544217586517334,-0.6958121657371521,-0.08901982754468918,-0.6768884658813477,-0.559264600276947,0.24360325932502