VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 8, 'such as high-resolution HRCT and 3D reconstruction, are often used to identify the target bronchus. However, the compression and distortion of adjacent bronchial structures by GEB may obscure anatomical relationships, leading to misidentification of the target bronchus, as demonstrated in our case, where initial HRCT localization discrepancies were corrected via percutaneous aspiration and drug injection, although such cases are relatively rare. Additionally, GEB may alter bronchial orientation or collapse aerated pathways, complicating preoperative planning. Advanced navigation tools (e.g., electromagnetic or virtual bronchoscopy) may improve accuracy, but their efficacy in GEB cases remains understudied. Meta-analytical evidence indicates that the success of EBV therapy is highly dependent on achieving complete isolation of the target lung region.', '{0.2695499658584595,-0.053249407559633255,0.08015485107898712,-0.1710122525691986,0.23886053264141083,-0.3364935517311096,-0.39137011766433716,-0.8548921942710876,0.24443461000919342,0.3088051974773407,0.29106470942497253,-0.06498011946678162,0.01936478726565838,-0.3901708126068115,-0.13685490190982819,-0.44018465280532837,-0.44813358783721924,0.4993605613708496,0.34583744406700134,-0.5739421248435974,-0.28669437766075134,0.018954217433929443,0.4393439292907715,-0.30504176020622253,0.09273647516965866,0.19562146067619324,-0.7364000678062439,-0.3952183425426483,-0.2263692170381546,-0.6289089322090149,-0.3501488268375397,-0.2893155515193939,-0.047347117215394974,-0.0024463944137096405,-0.41603949666023254,0.8234877586364746,0.3813561499118805,0.6568581461906433,-0.8424473404884338,0.2587302625179291,-0.5978607535362244,1.0462234020233154,0.18940772116184235,-0.42552250623703003,0.09199656546115875,0.005388337187469006,-0.1670268177986145,0.3132820129394531,0.5002310872077942,0.5101860761642456,-0.010357812978327274,0.11150706559419632,0.097959496080