VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 9, 'uccess of EBV therapy is highly dependent on achieving complete isolation of the target lung region. As indicated by relevant studies, Takizawa et al When the patient was in the supine position, the erythromycin lactobionate solution injected into GEB via the drainage tube indeed tended to deposit dorsally due to gravitational effects. To address this, air extraction via the drainage tube was performed to rapidly reduce the GEB volume, causing the bulla to collapse toward its base. Following drug injection through the drainage tube, the majority of the drug deposits in the dorsal region of the GEB, while a small portion may accumulate at the bulla base and subsequently enter the lung parenchyma via the target bronchus (especially after positional changes), potentially causing drug-related pneumonia. In this case, after catheterization and aspiration of the GEB, the bulla shrank toward the right upper lobe, preliminarily localizing the target bronchus to the right upper lobe.', '{0.5112343430519104,-0.029196716845035553,-0.23672492802143097,-0.24478574097156525,0.16416868567466736,-0.09574263542890549,-0.2996610999107361,-0.8125755786895752,-0.2706477642059326,0.08540608733892441,0.2046331912279129,-0.03667343035340309,-0.34645310044288635,0.01717556081712246,0.21531426906585693,-0.28722816705703735,-0.84852135181427,0.09090884774923325,0.5145472288131714,-0.6844234466552734,0.17862072587013245,0.2607692778110504,0.5866873264312744,-0.24653008580207825,0.4516458809375763,0.4403868019580841,-0.4135633111000061,-0.19326867163181305,-0.37853726744651794,-0.4028891921043396,-0.020101793110370636,-0.13799774646759033,-0.06802850216627121,0.7214574217796326,-0.13991442322731018,0.6859502196311951,0.7722744941711426,-0.06458371132612228,-1.387894868850708,0.29117223620414734,-0.319859117269516,0.7560971975326538,-0.14895915985107422,-0.7660374045372009,-0.13477379083633423,-0.3608723282814026,-0.5748865