VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 11, 'onchoscopic EBV placement, percutaneous bulla reduction demonstrates significant cost-effectiveness. Data from recent studies indicate that EBV placement imposes substantial economic strain, as each GEB patient typically requires implantation of 3 valves on average, This case report highlights the efficacy of a combined percutaneous and bronchoscopic approach for volume reduction in surgically ineligible patients with GEB. By integrating CT-guided aspiration, intrabullous sclerotherapy, and selective bronchial occlusion, this minimally invasive strategy achieved complete GEB closure, significant symptomatic improvement, and functional recovery in a high-risk patient with severe COPD. Notably, the use of percutaneous drug injection and aspiration proved instrumental in refining target bronchus identification when conventional imaging yielded ambiguous results, thereby enhancing procedural precision.', '{0.42825713753700256,-0.22145909070968628,0.16617004573345184,-0.08636018633842468,0.05272744596004486,-0.44227680563926697,-0.573194146156311,-1.0169651508331299,0.6696504950523376,-0.11517267674207687,0.11499745398759842,0.5524597764015198,0.09160543233156204,-0.24602696299552917,0.8498106002807617,0.06152539700269699,-0.6896181106567383,0.19493593275547028,0.4136385917663574,-0.7263748049736023,0.024687670171260834,0.1316239982843399,0.3242332339286804,0.18523584306240082,0.42641499638557434,0.3570166826248169,-0.2355962097644806,-0.030798664316534996,-0.19488558173179626,-0.7870723605155945,-0.3677559792995453,-0.31032654643058777,-0.41937246918678284,0.3424375653266907,0.0332699790596962,0.603271484375,0.585649847984314,0.6904956102371216,-1.0831351280212402,0.8020744323730469,-0.22352449595928192,1.2255315780639648,-0.27542734146118164,-0.16089047491550446,-0.10819067806005478,-0.6206739544868469,-0.720544159412384,0.3935413062572479,0.5544678568840027,0.30735448002815247,0.27572059631347656